import styles from './List.module.css';

export default function List({ itens, index }) {
    return (
        <>
            <h3>Melhores do Mundo</h3>
            <ol className={styles.list}>
                {itens.map((item) => (
                    <li key={index}>{item}</li>
                ))}
            </ol>
        </>
    )
}
